Solution: Here is a possible implementation of the onSubmit function in React:
```js
import axios from 'axios';

const onSubmit = async (values) => {
  try {
    const response = await axios.post('https://api.example.com/graphql', {
      query: `mutation($input: Input!) { create(input: $input) { id } }`,
      variables: {
        input: values,
      },
    });

    return response.data.data.create.id;
  } catch (error) {
    return error.message;
  }
};
```
